        <ResponseRow professor="antonella"/>
        <div></div>
        <ResponseRow professor="golitsyn"/>
        <div></div>
        <ResponseRow professor="shiff"/>
        <div></div>
        <ResponseRow professor="hickey"/>
      </div>
    );
  }

function ResponseRow(props) {
  return (
    <div class='row'>
      <div class="col-lg-5 col-md-5 col-sm-5 response-row">{props.professor}</div>
      <div class="col-lg-5 col-md-5 col-sm-5 response-row">course name</div>
      <button class="btn-lg col-lg-2 col-md-2 col-sm-2 response-row">send reminder</button>
    </div>
  );
}
export default Admin;
